import React from "react";
import '../styles/Button.css';

export default props => {

let classes = `button`
classes += props.operation ? `operation` : `button`
classes += props.double ? `double` : `button`
classes += props.triple ? `triple`: `button`


return(<button className={classes}>
{props.label}
</button>
)
}
